import React, { Component } from 'react';
import 'assets/css/estilos.css';

import MainStore from 'src/app/stores/MainStore';
import cadastrarUsuario from 'app/actions/CadastroActions';

cadastrar = nome => MainStore.cadastrarUsuario(cadastrar);

export class CadastroView extends Component {
    render() {
        return (
            <div>
                <header>
                    <p>Teste</p>

                </header>
            </div>
        );
    }
}
